import React, { useState, useEffect } from 'react';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';
import { params } from './params'; // Assuming params is correctly imported

export default function FullParameterList({ param_type }) {
    const [products, setProducts] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        setLoading(true); // Set loading to true each time param_type changes

        if (param_type === 'standard') {
            setProducts(params.getStandardParams());
            setLoading(false); // Set loading to false after data is fetched
        } else if (param_type === 'advanced') {
            console.log('Fetching advanced params...');
            // Here you would fetch and set advanced params data
            // For now, simulating with an empty array
            setProducts([]); // Example for advanced params
            setLoading(false);
        } else if (param_type === 'full') {
            console.log('Fetching full params...');
            // Here you would fetch and set full params data
            // For now, simulating with an empty array
            setProducts([]); // Example for full params
            setLoading(false);
        }
    }, [param_type]);

    return (
        <div className="card">
            {loading ? (
                <p>Loading data...</p> // Add a loading message
            ) : products.length === 0 ? (
                <p>No data available.</p> // Handle empty data case
            ) : (
                <DataTable value={products} tableStyle={{ minWidth: '50rem' }} paginator rows={10}>
                    {/* Define the columns you want to display in the DataTable */}
                    {Object.keys(products[0]).map((key) => (
                        <Column key={key} field={key} header={key.replace(/_/g, ' ')} />
                    ))}
                </DataTable>
            )}
        </div>
    );
}
